import { useStarknet } from '@starknet-react/core';
import { Navig } from '../components/home';
import { MaxBuyPerTx, MaxSupplyForMint, PaymentTokenAddress, ProjectNFTAddress, PublicSaleOpen, ReservedSupplyForMint, UnitPrice, WhitelistedSaleOpen, WhitelistMerkleRoot } from '../components/NFT';
import { ConnectButton, DisconnectButton } from '../components/Wallet';
import { MINTER_CONTRACT_ADDRESS } from '../contracts/addresses';

function TestPage() {
    const { account } = useStarknet();

    return (

        <>
        <div className="w-full min-h-screen grid grid-cols-12 justify-items-center px-20 bg-black min-h-screen content-start position relative">
            <img src="dancerhome.png" className='col-span-12 w-full h-full object-cover absolute z-0' alt="" />
            <Navig />
            <div className='col-span-12 w-full grid grid-cols-12 justify-items-center content-center z-10 h-screen'>
                <div className='col-span-5  grid justify-center content-center h-screen w-3/5' >
                    <img src="/img/wlogo.png" alt="" />
                </div>
                <div className='col-span-7 w-full grid grid-rows-6 content-center h-screen' >
                   <div className='row-span-3 grid justify-center content-center text-6xl font-extrabold text-white'><h1>WE BUILD TECH TO MAKE ART MORE ACCESSIBLE</h1> </div>
                   <div className='row-span-3 grid justify-center content-center'><button className='bg-gray-200 rounded-full h-10 w-24 bg-gradient-to-r hover:text-white hover:from-pink-500 hover:to-yellow-500'>
                            testnet
                        </button></div>
                </div>
            </div>
         </div>
        </>


    );
}

export default TestPage;
